DROP TABLE IF EXISTS `bank_accounts`;
CREATE TABLE `bank_accounts` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `bank_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `account_number_last_four` varchar(4) COLLATE utf8mb4_unicode_ci NOT NULL,
  `account_type` enum('checking','savings','credit_card') COLLATE utf8mb4_unicode_ci NOT NULL,
  `store_id` bigint(20) unsigned DEFAULT NULL,
  `opening_balance` decimal(10,2) NOT NULL DEFAULT '0.00',
  `current_balance` decimal(10,2) NOT NULL DEFAULT '0.00',
  `last_reconciled_date` date DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `bank_accounts_store_id_index` (`store_id`),
  KEY `bank_accounts_is_active_index` (`is_active`),
  CONSTRAINT `bank_accounts_store_id_foreign` FOREIGN KEY (`store_id`) REFERENCES `stores` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `bank_transactions`;
CREATE TABLE `bank_transactions` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `bank_account_id` bigint(20) unsigned NOT NULL,
  `transaction_date` date NOT NULL,
  `post_date` date DEFAULT NULL,
  `description` text COLLATE utf8mb4_unicode_ci,
  `transaction_type` enum('debit','credit') COLLATE utf8mb4_unicode_ci NOT NULL,
  `amount` decimal(10,2) NOT NULL,
  `balance` decimal(10,2) DEFAULT NULL,
  `reference_number` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `matched_expense_id` bigint(20) unsigned DEFAULT NULL,
  `matched_revenue_id` bigint(20) unsigned DEFAULT NULL,
  `reconciliation_status` enum('unmatched','matched','reviewed','exception') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'unmatched',
  `reconciliation_notes` text COLLATE utf8mb4_unicode_ci,
  `import_batch_id` bigint(20) unsigned DEFAULT NULL,
  `duplicate_check_hash` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `bank_transactions_bank_account_id_foreign` (`bank_account_id`),
  KEY `bank_transactions_matched_expense_id_foreign` (`matched_expense_id`),
  KEY `bank_transactions_matched_revenue_id_foreign` (`matched_revenue_id`),
  KEY `bank_transactions_import_batch_id_foreign` (`import_batch_id`),
  KEY `bank_transactions_transaction_date_bank_account_id_index` (`transaction_date`,`bank_account_id`),
  KEY `bank_transactions_transaction_date_index` (`transaction_date`),
  KEY `bank_transactions_reconciliation_status_index` (`reconciliation_status`),
  KEY `bank_transactions_duplicate_check_hash_index` (`duplicate_check_hash`),
  CONSTRAINT `bank_transactions_bank_account_id_foreign` FOREIGN KEY (`bank_account_id`) REFERENCES `bank_accounts` (`id`) ON DELETE CASCADE,
  CONSTRAINT `bank_transactions_import_batch_id_foreign` FOREIGN KEY (`import_batch_id`) REFERENCES `import_batches` (`id`) ON DELETE SET NULL,
  CONSTRAINT `bank_transactions_matched_expense_id_foreign` FOREIGN KEY (`matched_expense_id`) REFERENCES `expense_transactions` (`id`) ON DELETE SET NULL,
  CONSTRAINT `bank_transactions_matched_revenue_id_foreign` FOREIGN KEY (`matched_revenue_id`) REFERENCES `daily_reports` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `cache`;
CREATE TABLE `cache` (
  `key` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `value` mediumtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `expiration` int(11) NOT NULL,
  PRIMARY KEY (`key`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

