DROP TABLE IF EXISTS `coa_store_assignments`;
CREATE TABLE `coa_store_assignments` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `coa_id` bigint(20) unsigned NOT NULL,
  `store_id` bigint(20) unsigned NOT NULL,
  `is_global` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `coa_store_assignments_coa_id_store_id_unique` (`coa_id`,`store_id`),
  KEY `coa_store_assignments_store_id_foreign` (`store_id`),
  CONSTRAINT `coa_store_assignments_coa_id_foreign` FOREIGN KEY (`coa_id`) REFERENCES `chart_of_accounts` (`id`) ON DELETE CASCADE,
  CONSTRAINT `coa_store_assignments_store_id_foreign` FOREIGN KEY (`store_id`) REFERENCES `stores` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `daily_reports`;
CREATE TABLE `daily_reports` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `projected_sales` decimal(10,2) NOT NULL DEFAULT '0.00',
  `amount_of_cancels` decimal(10,2) NOT NULL DEFAULT '0.00',
  `amount_of_voids` decimal(10,2) NOT NULL DEFAULT '0.00',
  `number_of_no_sales` int(11) NOT NULL DEFAULT '0',
  `total_coupons` int(11) NOT NULL DEFAULT '0',
  `gross_sales` decimal(10,2) NOT NULL DEFAULT '0.00',
  `coupons_received` decimal(10,2) NOT NULL DEFAULT '0.00',
  `adjustments_overrings` decimal(10,2) NOT NULL DEFAULT '0.00',
  `total_customers` int(11) NOT NULL DEFAULT '0',
  `net_sales` decimal(10,2) NOT NULL DEFAULT '0.00',
  `tax` decimal(10,2) NOT NULL DEFAULT '0.00',
  `average_ticket` decimal(10,2) NOT NULL DEFAULT '0.00',
  `sales` decimal(10,2) NOT NULL DEFAULT '0.00',
  `total_paid_outs` decimal(10,2) NOT NULL DEFAULT '0.00',
  `credit_cards` decimal(10,2) NOT NULL DEFAULT '0.00',
  `cash_to_account` decimal(10,2) NOT NULL DEFAULT '0.00',
  `actual_deposit` decimal(10,2) NOT NULL DEFAULT '0.00',
  `short` decimal(10,2) NOT NULL DEFAULT '0.00',
  `over` decimal(10,2) NOT NULL DEFAULT '0.00',
  `report_date` date DEFAULT NULL,
  `page_number` int(11) NOT NULL DEFAULT '1',
  `weather` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `holiday_event` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `store_id` bigint(20) unsigned DEFAULT NULL,
  `created_by` bigint(20) unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `daily_reports_store_id_report_date_unique` (`store_id`,`report_date`),
  KEY `idx_store_date` (`store_id`,`report_date`),
  KEY `idx_created_by` (`created_by`),
  KEY `idx_report_date` (`report_date`),
  KEY `idx_created_at` (`created_at`),
  KEY `idx_daily_reports_created_by` (`created_by`),
  KEY `idx_daily_reports_report_date` (`report_date`),
  KEY `idx_daily_reports_store_date` (`store_id`,`report_date`),
  KEY `idx_daily_reports_date_sales` (`report_date`,`gross_sales`),
  KEY `idx_daily_reports_created_at` (`created_at`),
  CONSTRAINT `daily_reports_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `daily_reports_store_id_foreign` FOREIGN KEY (`store_id`) REFERENCES `stores` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

