DROP TABLE IF EXISTS `expense_transactions`;
CREATE TABLE `expense_transactions` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `transaction_type` enum('cash','credit_card','bank_transfer','check') COLLATE utf8mb4_unicode_ci NOT NULL,
  `transaction_date` date NOT NULL,
  `post_date` date DEFAULT NULL,
  `store_id` bigint(20) unsigned NOT NULL,
  `vendor_id` bigint(20) unsigned DEFAULT NULL,
  `vendor_name_raw` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `coa_id` bigint(20) unsigned DEFAULT NULL,
  `amount` decimal(10,2) NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci,
  `reference_number` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `payment_method` enum('cash','credit_card','debit_card','check','eft','other') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'cash',
  `card_last_four` varchar(4) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `receipt_url` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `notes` text COLLATE utf8mb4_unicode_ci,
  `is_reconciled` tinyint(1) NOT NULL DEFAULT '0',
  `reconciled_date` timestamp NULL DEFAULT NULL,
  `reconciled_by` bigint(20) unsigned DEFAULT NULL,
  `needs_review` tinyint(1) NOT NULL DEFAULT '0',
  `review_reason` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `duplicate_check_hash` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `import_batch_id` bigint(20) unsigned DEFAULT NULL,
  `daily_report_id` bigint(20) unsigned DEFAULT NULL,
  `created_by` bigint(20) unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `third_party_statement_id` bigint(20) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `expense_transactions_store_id_foreign` (`store_id`),
  KEY `expense_transactions_reconciled_by_foreign` (`reconciled_by`),
  KEY `expense_transactions_created_by_foreign` (`created_by`),
  KEY `expense_transactions_transaction_date_store_id_index` (`transaction_date`,`store_id`),
  KEY `expense_transactions_needs_review_store_id_index` (`needs_review`,`store_id`),
  KEY `expense_transactions_is_reconciled_index` (`is_reconciled`),
  KEY `expense_transactions_vendor_id_index` (`vendor_id`),
  KEY `expense_transactions_coa_id_index` (`coa_id`),
  KEY `expense_transactions_daily_report_id_index` (`daily_report_id`),
  KEY `expense_transactions_transaction_date_index` (`transaction_date`),
  KEY `expense_transactions_duplicate_check_hash_index` (`duplicate_check_hash`),
  KEY `expense_transactions_import_batch_id_index` (`import_batch_id`),
  KEY `expense_transactions_third_party_statement_id_foreign` (`third_party_statement_id`),
  CONSTRAINT `expense_transactions_coa_id_foreign` FOREIGN KEY (`coa_id`) REFERENCES `chart_of_accounts` (`id`),
  CONSTRAINT `expense_transactions_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`),
  CONSTRAINT `expense_transactions_daily_report_id_foreign` FOREIGN KEY (`daily_report_id`) REFERENCES `daily_reports` (`id`) ON DELETE SET NULL,
  CONSTRAINT `expense_transactions_import_batch_id_foreign` FOREIGN KEY (`import_batch_id`) REFERENCES `import_batches` (`id`) ON DELETE SET NULL,
  CONSTRAINT `expense_transactions_reconciled_by_foreign` FOREIGN KEY (`reconciled_by`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `expense_transactions_store_id_foreign` FOREIGN KEY (`store_id`) REFERENCES `stores` (`id`) ON DELETE CASCADE,
  CONSTRAINT `expense_transactions_third_party_statement_id_foreign` FOREIGN KEY (`third_party_statement_id`) REFERENCES `third_party_statements` (`id`) ON DELETE SET NULL,
  CONSTRAINT `expense_transactions_vendor_id_foreign` FOREIGN KEY (`vendor_id`) REFERENCES `vendors` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

