DROP TABLE IF EXISTS `third_party_statements`;
CREATE TABLE `third_party_statements` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `platform` enum('grubhub','ubereats','doordash','postmates','other') COLLATE utf8mb4_unicode_ci NOT NULL,
  `store_id` bigint(20) unsigned NOT NULL,
  `statement_date` date NOT NULL,
  `statement_id` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `gross_sales` decimal(10,2) NOT NULL DEFAULT '0.00',
  `marketing_fees` decimal(10,2) NOT NULL DEFAULT '0.00',
  `delivery_fees` decimal(10,2) NOT NULL DEFAULT '0.00',
  `processing_fees` decimal(10,2) NOT NULL DEFAULT '0.00',
  `net_deposit` decimal(10,2) NOT NULL DEFAULT '0.00',
  `sales_tax_collected` decimal(10,2) NOT NULL DEFAULT '0.00',
  `import_batch_id` bigint(20) unsigned DEFAULT NULL,
  `file_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `file_hash` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `imported_by` bigint(20) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `third_party_statements_import_batch_id_foreign` (`import_batch_id`),
  KEY `third_party_statements_imported_by_foreign` (`imported_by`),
  KEY `third_party_statements_platform_statement_date_index` (`platform`,`statement_date`),
  KEY `third_party_statements_store_id_index` (`store_id`),
  KEY `third_party_statements_statement_id_index` (`statement_id`),
  CONSTRAINT `third_party_statements_import_batch_id_foreign` FOREIGN KEY (`import_batch_id`) REFERENCES `import_batches` (`id`) ON DELETE SET NULL,
  CONSTRAINT `third_party_statements_imported_by_foreign` FOREIGN KEY (`imported_by`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `third_party_statements_store_id_foreign` FOREIGN KEY (`store_id`) REFERENCES `stores` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `transaction_mapping_rules`;
CREATE TABLE `transaction_mapping_rules` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `description_pattern` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `vendor_id` bigint(20) unsigned DEFAULT NULL,
  `coa_id` bigint(20) unsigned NOT NULL,
  `confidence_score` decimal(3,2) NOT NULL DEFAULT '0.00' COMMENT '0.00 to 1.00',
  `times_used` int(11) NOT NULL DEFAULT '0',
  `times_correct` int(11) NOT NULL DEFAULT '0',
  `times_incorrect` int(11) NOT NULL DEFAULT '0',
  `last_used` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `transaction_mapping_rules_vendor_id_foreign` (`vendor_id`),
  KEY `transaction_mapping_rules_coa_id_foreign` (`coa_id`),
  KEY `transaction_mapping_rules_confidence_score_index` (`confidence_score`),
  KEY `transaction_mapping_rules_last_used_index` (`last_used`),
  KEY `pattern_vendor_index` (`description_pattern`,`vendor_id`),
  KEY `transaction_mapping_rules_description_pattern_index` (`description_pattern`),
  CONSTRAINT `transaction_mapping_rules_coa_id_foreign` FOREIGN KEY (`coa_id`) REFERENCES `chart_of_accounts` (`id`),
  CONSTRAINT `transaction_mapping_rules_vendor_id_foreign` FOREIGN KEY (`vendor_id`) REFERENCES `vendors` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `transaction_types`;
CREATE TABLE `transaction_types` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `p_id` bigint(20) unsigned DEFAULT NULL,
  `default_coa_id` bigint(20) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `transaction_types_p_id_foreign` (`p_id`),
  KEY `transaction_types_default_coa_id_foreign` (`default_coa_id`),
  CONSTRAINT `transaction_types_default_coa_id_foreign` FOREIGN KEY (`default_coa_id`) REFERENCES `chart_of_accounts` (`id`) ON DELETE SET NULL,
  CONSTRAINT `transaction_types_p_id_foreign` FOREIGN KEY (`p_id`) REFERENCES `transaction_types` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

