DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `google_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `avatar` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `state` varchar(2) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'US State code (e.g., CA, NY, TX)',
  `email_verified_at` timestamp NULL DEFAULT NULL,
  `password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `role` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_by` bigint(20) unsigned DEFAULT NULL,
  `remember_token` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `username` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `assigned_stores` json DEFAULT NULL,
  `last_online` timestamp NULL DEFAULT NULL,
  `home_address` text COLLATE utf8mb4_unicode_ci,
  `personal_phone` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `personal_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `corporate_address` text COLLATE utf8mb4_unicode_ci,
  `corporate_phone` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `corporate_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `fanns_philly_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `corporate_ein` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `corporate_creation_date` date DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `store_id` bigint(20) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`),
  KEY `idx_users_role` (`role`),
  KEY `idx_users_email` (`email`),
  KEY `idx_users_created_by` (`created_by`),
  KEY `idx_users_last_online` (`last_online`),
  KEY `idx_users_role_created_at` (`role`,`created_at`),
  KEY `users_store_id_index` (`store_id`),
  CONSTRAINT `users_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `users_store_id_foreign` FOREIGN KEY (`store_id`) REFERENCES `stores` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

